/*Table structure for table `tenant` */

DROP TABLE IF EXISTS `tenant`;

CREATE TABLE `tenant` (
  `id` bigint(2) NOT NULL AUTO_INCREMENT,
  `companyName` varchar(255) DEFAULT NULL COMMENT '公司名称',
  `companyTel` varchar(255) DEFAULT NULL COMMENT '公司电话',
  `companyNum` varchar(255) DEFAULT NULL COMMENT '统一社会信用编号',
  `email` varchar(255) DEFAULT NULL COMMENT '公司邮箱',
  `sysName` varchar(255) DEFAULT NULL COMMENT '登录用户名',
  `registerTime` datetime DEFAULT NULL COMMENT '注册时间',
  `state` varchar(2) DEFAULT NULL COMMENT '租户状态：0正常 ；1禁用',
  `address` varchar(255) DEFAULT NULL,
  `logo` varchar(255) DEFAULT NULL,
  `meal_id` bigint(2) DEFAULT NULL,
  `ispay` bit(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `meal_id` (`meal_id`)
) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=utf8;

